import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>언생동 웹 애플리케이션</h1>
        <p>
          React로 만든 첫 번째 웹 애플리케이션입니다.
        </p>
        <p>
          <code>src/App.js</code> 파일을 수정해서 시작하세요.
        </p>
      </header>
      <main className="App-main">
        <section className="welcome-section">
          <h2>환영합니다!</h2>
          <p>여기서 웹 애플리케이션을 개발해보세요.</p>
        </section>
      </main>
    </div>
  );
}

export default App;
